void skeet_components::draw_aim_button(int x, int y, bool selected)
{
	int vertex_counter = 0;
	d3d_color main_color = selected ? d3d_color_argb(255, 210, 210, 210) : d3d_color_argb(255, 90, 90, 90);
	d3d_color aa_color = selected ? d3d_color_argb(255, 113, 113, 113) : d3d_color_argb(255, 47, 47, 47);

	/*for (size_t i = 0; i < 64; i++)
	{
		for (size_t j = 0; j < 64; j++)
		{
			if (skeet_aim_button_mask[i] & b_64(j))
				drawing::vertex[vertex_counter++] = { static_cast<float>(x + j), static_cast<float>(y + i), 0.0f, 1.0f, d3d_color_argb(150, 11, 11, 11) };

			if (skeet_aim_button_aa_mask[i] & b_64(j))
				drawing::vertex[vertex_counter++] = { static_cast<float>(x + j), static_cast<float>(y + i), 0.0f, 1.0f, d3d_color_argb(150, 11, 11, 11) };
		}
	}*/

	for (size_t i = 0; i < 64; i++)
	{
		for (size_t j = 0; j < 64; j++)
		{
			if (skeet_aim_button_mask[i] & b_64(j))
				drawing::vertex[vertex_counter++] = { static_cast<float>(x + j), static_cast<float>(y + i), 0.0f, 1.0f, main_color };

			if (skeet_aim_button_aa_mask[i] & b_64(j))
				drawing::vertex[vertex_counter++] = { static_cast<float>(x + j), static_cast<float>(y + i), 0.0f, 1.0f, aa_color };
		}
	}

	overlay::device->DrawPrimitiveUP(D3DPT_POINTLIST, vertex_counter, drawing::vertex, sizeof(c_vertex));
}

